@robertfontainegallery presents “Intimate” opening June 4 with reception Saturday June 10 and will feature works by @justynakisielewicz #loufratino @larryclarkofficial #williambrickel @nickgentryart and some other amazing artists! If you are in Miami this is a must see 👀🍆🥖🍑🌶️🖼️🎞️🛹🍾🥂🍷

Justyna’s “Daddy’s Boys” will be featured! 

Address:  100 Collins Ave, Miami Beach, FL 33139

🌈My June openings: 

@madarts_space, June 2, 5-11pm - group show dedicated to everything erotica; digital, traditional, performance, and more! 📍Dania Beach/Florida

@robertfontainegallery - June 10th, 8-10pm 
- group show titled “intimate” exploring themes of identity and intimacy. 📍South Miami/Florida 

@mcsw_elektrownia_official June 17th, from 4pm
Titled “sports Game” the group show explores different takes on sports in arts. 📍Radom/Poland 

I’ll be attending all of these openings with the exception of the Polish one. There I’ll be present at the show’s closing party on September 10th! 
Which show will you go to?! 

#artgallery #artmuseum #groupshow #representationalart #artnude #genderidentity #pridemonth #internationalartist #polskaartystka #malarka #contemporaryart #oilpainter #justynakisielewicz

Juz jutro o godz. 16:00 otwarcie grupowej wystawy w @mcsw_elektrownia_official  pt. „Sport Games” w której biorę udział! Wyjątkowo nie bedzie mnie na otwarciu a dopiero na zamknięciu wystawy. Minie wiec troche czasu zanim zobaczę cała ekspozycje. Podobno 🤫szykuje sie kilka niespodzianek, dlatego próżno szukać zdjec wystawy w sieci. Trzymają cos w tajemnicy 🤫
Warto zajrzeć, tym bardziej ze juz niedługo bede tam z własna wystawa. Narazie tyle o tym, a tymczasem duża i super wystawa już jutro! 
